        text\" href=\"http://nasdaq.com/nasdaq-100\">nasdaq<wbr />.com<wbr />/nasdaq-100</a></span></td></tr></tbody></table>\n<p>The
        <b>Nasdaq-100</b> (<b>^NDX</b><sup id=\"cite_ref-2\" class=\"reference\"><a
        href=\"#cite_note-2\">&#91;2&#93;</a></sup>) is a <a href=\"/wiki/Stock_market_index\"
        title=\"Stock market index\">stock market index</a> made up of 101 equity
        securities issued by 100 of the largest non-financial companies listed on
        the <a href=\"/wiki/Nasdaq\" title=\"Nasdaq\">Nasdaq</a> stock exchange. It
        is a modified <a href=\"/wiki/Capitalization-weighted_index\" title=\"Capitalization-weighted
        index\">capitalization-weighted index</a>. The stocks' weights in the index
        are based on their <a href=\"/wiki/Market_capitalization\" title=\"Market
        capitalization\">market capitalizations</a>, with certain rules capping the
        influence of the largest components. It is limited to companies from a single
        exchange, and it does not have any financial companies. The financial companies
        are in a separate index, the <a href=\"/wiki/Nasdaq_Financial-100\" title=\"Nasdaq
        Financial-100\">Nasdaq Financial-100</a>.\n</p>\n<meta property=\"mw:PageProp/toc\"
        />\n<h2><span class=\"mw-headline\" id=\"History\">History</span><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=1\"
        title=\"Edit section: History\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>The
        Nasdaq-100 was launched on January 31, 1985 by the Nasdaq.<sup id=\"cite_ref-3\"
        class=\"reference\"><a href=\"#cite_note-3\">&#91;3&#93;</a></sup> It created
        two indices: the Nasdaq-100, which consists of <a href=\"/wiki/Industrial_sector\"
        class=\"mw-redirect\" title=\"Industrial sector\">Industrial</a>, <a href=\"/wiki/Technology\"
        title=\"Technology\">Technology</a>, <a href=\"/wiki/Retail\" title=\"Retail\">Retail</a>,
        <a href=\"/wiki/Telecommunication\" class=\"mw-redirect\" title=\"Telecommunication\">Telecommunication</a>,
        <a href=\"/wiki/Biotechnology\" title=\"Biotechnology\">Biotechnology</a>,
        <a href=\"/wiki/Health_care\" title=\"Health care\">Health Care</a>, <a href=\"/wiki/Transportation\"
        class=\"mw-redirect\" title=\"Transportation\">Transportation</a>, <a href=\"/wiki/Mass_media\"
        title=\"Mass media\">Media</a> and <a href=\"/wiki/Tertiary_sector_of_the_economy\"
        title=\"Tertiary sector of the economy\">Service</a> companies, and the <a
        href=\"/wiki/Nasdaq_Financial-100\" title=\"Nasdaq Financial-100\">Nasdaq
        Financial-100</a>, which consists of <a href=\"/wiki/Bank\" title=\"Bank\">banking
        companies</a>, <a href=\"/wiki/Insurance_company\" class=\"mw-redirect\" title=\"Insurance
        company\">insurance firms</a>, <a href=\"/wiki/Brokerage_firm\" class=\"mw-redirect\"
        title=\"Brokerage firm\">brokerage firms</a>, and <a href=\"/wiki/Mortgage_loan\"
        title=\"Mortgage loan\">Mortgage loan</a> companies.\n</p><p>The base price
        of the index was initially set at 250, but when it closed near 800 on December
        31, 1993, the base was reset at 125 the following trading day, leaving the
        halved Nasdaq-100 price below that of the more commonly known <a href=\"/wiki/Nasdaq_Composite\"
        title=\"Nasdaq Composite\">Nasdaq Composite</a>. The first annual adjustments
        were made in 1993 in advance of options on the index that would trade at the
        <a href=\"/wiki/Chicago_Board_Options_Exchange\" title=\"Chicago Board Options
        Exchange\">Chicago Board Options Exchange</a> in 1994. Foreign companies were
        first admitted to the Nasdaq-100 in January 1998, but had higher standards
        to meet before they could be added. Those standards were relaxed in 2002,
        while standards for domestic firms were raised, ensuring that all companies
        met the same standards.\n</p>\n<h2><span class=\"mw-headline\" id=\"Investing_in_the_Nasdaq-100\">Investing
        in the Nasdaq-100</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=2\" title=\"Edit
        section: Investing in the Nasdaq-100\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>The
        <a href=\"/wiki/Invesco\" title=\"Invesco\">Invesco</a> QQQ <a href=\"/wiki/Exchange-traded_fund\"
        title=\"Exchange-traded fund\">exchange-traded fund</a>, sponsored and overseen
        since March 21, 2007 by <a href=\"/wiki/Invesco\" title=\"Invesco\">Invesco</a>,
        trades under the ticker <a href=\"/wiki/Nasdaq\" title=\"Nasdaq\">Nasdaq</a>:&#160;<a
        rel=\"nofollow\" class=\"external text\" href=\"https://www.nasdaq.com/market-activity/stocks/qqq\">QQQ</a>.
        It is nicknamed \u201Ctriple Qs\u201D or \u201Ccubes\u201D. It was formerly
        called Nasdaq-100 Trust Series 1. On December 1, 2004, it was moved from the
        <a href=\"/wiki/American_Stock_Exchange\" class=\"mw-redirect\" title=\"American
        Stock Exchange\">American Stock Exchange</a>, where it had the symbol QQQ,
        to the <a href=\"/wiki/Nasdaq\" title=\"Nasdaq\">Nasdaq</a>, and given the
        new ticker symbol QQQQ, sometimes called the \"quad Qs\" by traders. On March
        23, 2011, Nasdaq changed its symbol back to QQQ.<sup id=\"cite_ref-4\" class=\"reference\"><a
        href=\"#cite_note-4\">&#91;4&#93;</a></sup> Retail buy and hold investors
        might prefer to purchase Invesco's similar Nasdaq: QQQM, or \"QQQ Mini\" which
        has a lower fee structure, but lacks the liquidity that high-frequency traders
        need in the traditional QQQ product.<sup id=\"cite_ref-5\" class=\"reference\"><a
        href=\"#cite_note-5\">&#91;5&#93;</a></sup>\n</p><p>QQQ is one of the most
        actively traded <a href=\"/wiki/Exchange-traded_fund\" title=\"Exchange-traded
        fund\">exchange-traded funds</a> in the United States.<sup id=\"cite_ref-6\"
        class=\"reference\"><a href=\"#cite_note-6\">&#91;6&#93;</a></sup>\n</p><p>The
        Nasdaq-100 is often abbreviated as NDX, NDQ, NAS100 or US100 in the <a href=\"/wiki/Derivatives_market\"
        title=\"Derivatives market\">derivatives markets</a>. Its corresponding <a
        href=\"/wiki/Futures_contract\" title=\"Futures contract\">futures contracts</a>
        are traded on the <a href=\"/wiki/Chicago_Mercantile_Exchange\" title=\"Chicago
        Mercantile Exchange\">Chicago Mercantile Exchange</a>. The regular futures
        are denoted by the <a href=\"/wiki/Reuters_Instrument_Code\" class=\"mw-redirect\"
        title=\"Reuters Instrument Code\">Reuters Instrument Code</a> ND, and the
        smaller <i>E-mini</i> version uses the code NQ. Both are among the most heavily
        traded futures at the exchange.<sup id=\"cite_ref-7\" class=\"reference\"><a
        href=\"#cite_note-7\">&#91;7&#93;</a></sup>\n</p>\n<h2><span class=\"mw-headline\"
        id=\"Performance\">Performance</span><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=3\"
        title=\"Edit section: Performance\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<h3><span
        id=\"Price_history_.26_milestones\"></span><span class=\"mw-headline\" id=\"Price_history_&amp;_milestones\">Price
        history &amp; milestones</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=4\" title=\"Edit
        section: Price history &amp; milestones\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\n<p>The
        index set highs above the 4,700 level at the peak of the <a href=\"/wiki/Dot-com_bubble\"
        title=\"Dot-com bubble\">dot-com bubble</a> in 2000, but fell 78% during the
        <a href=\"/wiki/Stock_market_downturn_of_2002\" title=\"Stock market downturn
        of 2002\">Stock market downturn of 2002</a>.<sup id=\"cite_ref-8\" class=\"reference\"><a
        href=\"#cite_note-8\">&#91;8&#93;</a></sup>\n</p><p>After a gradual 5-year
        recovery to an intraday high of 2,239.51 on October 31, 2007, the highest
        reached since February 16, 2002, the index corrected below the 2,000 level
        in early 2008 amid the <a href=\"/wiki/Late-2000s_recession\" class=\"mw-redirect\"
        title=\"Late-2000s recession\">Late-2000s recession</a>, the <a href=\"/wiki/United_States_housing_bubble\"
        class=\"mw-redirect\" title=\"United States housing bubble\">United States
        housing bubble</a> and the <a href=\"/wiki/Financial_crisis_of_2007%E2%80%932008\"
        class=\"mw-redirect\" title=\"Financial crisis of 2007\u20132008\">Financial
        crisis of 2007\u20132008</a>. Panic focusing on the failure of the investment
        banking industry culminated in a loss of more than 10% on September 29, 2008,
        subsequently plunging the index firmly into a <a href=\"/wiki/Bear_market\"
        class=\"mw-redirect\" title=\"Bear market\">bear market</a>. The Nasdaq-100,
        with much of the broader market, experienced a <a href=\"/wiki/Limit_down\"
        class=\"mw-redirect\" title=\"Limit down\">Limit down</a> open on October
        24 and reached a 6-year intraday low of 1,018 on November 20, 2008.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>Amid
        <a href=\"/wiki/Quantitative_easing\" title=\"Quantitative easing\">quantitative
        easing</a> (QE) from the <a href=\"/wiki/Federal_Reserve\" title=\"Federal
        Reserve\">Federal Reserve</a> and optimism that the financial crisis was ending,
        the index embarked on a volatile four-year climb higher, closing above 3,000
        on May 15, 2013 for the first time since November 15, 2000. By October 18,
        2013, with GOOG passing $1,000 per share for the first time, the index had
        made a closing high of 3,353.88 and intraday high of 3,355.63, its highest
        levels since the <a href=\"/wiki/2000_United_States_elections\" title=\"2000
        United States elections\">2000 United States elections</a> and more than triple
        the 2008 low.\n</p>\n<h3><span class=\"mw-headline\" id=\"Record_values\">Record
        values</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
