        2021</td>\n<td>72\n</td></tr></tbody></table>\n<h3><span class=\"mw-headline\"
        id=\"Annual_returns\">Annual returns</span><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=7\"
