>\n<td>648.66</td>\n<td>53.54\n</td></tr>\n<tr>\n<td>2010</td>\n<td>2,217.86</td>\n<td>357.55</td>\n<td>19.22\n</td></tr>\n<tr>\n<td>2011</td>\n<td>2,277.83</td>\n<td>59.97</td>\n<td>2.70\n</td></tr>\n<tr>\n<td>2012</td>\n<td>2,660.93</td>\n<td>383.10</td>\n<td>16.82\n</td></tr>\n<tr>\n<td>2013</td>\n<td>3,592.00</td>\n<td>931.07</td>\n<td>34.99\n</td></tr>\n<tr>\n<td>2014</td>\n<td>4,236.28</td>\n<td>644.28</td>\n<td>17.94\n</td></tr>\n<tr>\n<td>2015</td>\n<td>4,593.27</td>\n<td>356.99</td>\n<td>8.43\n</td></tr>\n<tr>\n<td>2016</td>\n<td>4,863.62</td>\n<td>270.35</td>\n<td>5.89\n</td></tr>\n<tr>\n<td>2017</td>\n<td>6,396.42</td>\n<td>1,532.80</td>\n<td>31.52\n</td></tr>\n<tr>\n<td>2018</td>\n<td>6,329.96</td>\n<td>\u221266.46</td>\n<td>\u22121.04\n</td></tr>\n<tr>\n<td>2019</td>\n<td>8,733.07</td>\n<td>2,403.11</td>\n<td>37.96\n</td></tr>\n<tr>\n<td>2020</td>\n<td>12,888.28</td>\n<td>4,155.21</td>\n<td>47.58\n</td></tr>\n<tr>\n<td>2021</td>\n<td>16,320.08</td>\n<td>3,431.80</td>\n<td>26.63\n</td></tr>\n<tr>\n<td>2022</td>\n<td>10,939.76</td>\n<td>\u22125,380.32</td>\n<td>\u221232.97\n</td></tr></tbody></table>\n<h2><span
        class=\"mw-headline\" id=\"Selection_criteria\">Selection criteria</span><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=8\" title=\"Edit
        section: Selection criteria\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>The
        Nasdaq has refined a series of stringent standards which companies must meet
        to be indexed. Those standards include:\n</p>\n<ul><li>Being listed exclusively
        on Nasdaq in either the Global Select or Global Market tiers.</li>\n<li>Being
        publicly offered on an established American market for at least three months.</li>\n<li>Having
        average daily volume of 200,000 shares.</li>\n<li>Being current in regards
        to quarterly and annual reports.</li>\n<li>Not being in <a href=\"/wiki/Bankruptcy\"
        title=\"Bankruptcy\">bankruptcy</a> proceedings.</li></ul>\n<p>Additionally,
        since 2014, companies with multiple classes of stock are allowed to have multiple
        classes included in the index, provided they meet Nasdaq's criteria. Prior
        to 2014, companies were limited to one class of stock in the index (usually
        the one with the larger market capitalization).<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<h3><span
        class=\"mw-headline\" id=\"Yearly_rebalancing_and_re-ranking\">Yearly rebalancing
        and re-ranking</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=9\" title=\"Edit
        section: Yearly rebalancing and re-ranking\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\n<p>While
        the composition of the Nasdaq-100 changes in the case of delisting (such as
        transferring to another exchange, <a href=\"/wiki/Mergers_and_acquisitions\"
        title=\"Mergers and acquisitions\">mergers and acquisitions</a>, or declaring
        <a href=\"/wiki/Bankruptcy\" title=\"Bankruptcy\">bankruptcy</a>, and in a
        few cases, being delisted by Nasdaq for failing to meet listing requirements),
        the index is rebalanced once a year, in December, when Nasdaq reviews its
        components, compares them with those not in the index, re-ranks all eligible
        companies and makes the appropriate adjustments.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>There
        are two tools the Nasdaq uses to determine the market values of companies
        for the annual review:\n</p>\n<ul><li>Share Prices as of the last trading
        day in October.</li>\n<li>Publicly announced share totals as of the last trading
        day of November.</li></ul>\n<p>Those components that are in the top 100 of
        all eligible companies at the annual review are retained in the index. Those
        ranked 101 to 125 are retained only if they were in the top 100 of the previous
        year's annual review. If they fail to move into the top 100 in the following
        year's review, they are dropped. Those not ranked in the top 125 are dropped
        regardless of the previous year's rank.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        index also drops a company if, at the end of two consecutive months, it fails
        to have an index weighting of at least one-tenth of a percent. This can occur
        at any time.<sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup> Companies that are dropped are replaced by
        those with the largest market value that are not already in the index. Anticipation
        of these changes can lead to changes in the stock prices of affected companies.<sup
        class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup>\n</p><p>The index publicly announces all
        changes, regardless of when they occur, via <a href=\"/wiki/Press_releases\"
        class=\"mw-redirect\" title=\"Press releases\">press releases</a> at least
        five business days before the change takes place. The 2018 results of the
        re-ranking and rebalancing were announced on December 14, with the changes
        effective the morning of December 24, coinciding with the expiration of options
        on December 21.<sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup>\n</p>\n<h2><span class=\"mw-headline\" id=\"Differences_from_Nasdaq_Composite_index\">Differences
        from Nasdaq Composite index</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=10\" title=\"Edit
        section: Differences from Nasdaq Composite index\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>The
        Nasdaq-100 is frequently confused with the <a href=\"/wiki/Nasdaq_Composite\"
        title=\"Nasdaq Composite\">Nasdaq Composite</a> Index. The latter index (often
        referred to simply as <i>\"The Nasdaq\"</i>) includes the stock of every company
        that is listed on Nasdaq (more than 3,000 altogether).<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        Nasdaq-100 is a modified <a href=\"/wiki/Capitalization-weighted_index\" title=\"Capitalization-weighted
        index\">capitalization-weighted index</a>. This particular methodology was
        created in 1998 in advance of the creation of the Nasdaq-100 Index Trust,
        which holds portions of all Nasdaq-100 firms. The new methodology allowed
        Nasdaq to reduce the influence of the largest companies and to allow for more
        diversification. However, the weights of the stocks were not changed after
        that, which led to more problems. In May 2011, Nasdaq did a major rebalance
        of the index to bring it closer to market-cap weighting.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>The
        index is rebalanced quarterly only if:\n</p>\n<ul><li>One company is worth
        24% of the index</li>\n<li>Companies with a weighting of at least 4.5% make
        up 48% or more of the index</li></ul>\n<p>The index is rebalanced annually,
        after the quarterly rebalancing, only if:\n</p>\n<ul><li>One company is worth
        15% of the index</li>\n<li>The five largest companies by market capitalizations
        have weights of 40% or more of the index<sup id=\"cite_ref-12\" class=\"reference\"><a
        href=\"#cite_note-12\">&#91;12&#93;</a></sup></li></ul>\n<h2><span class=\"mw-headline\"
        id=\"Differences_from_other_indices\">Differences from other indices</span><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=11\" title=\"Edit
        section: Differences from other indices\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>In
        addition to its almost complete lack of financial companies, the Nasdaq-100
        includes five companies incorporated outside the United States. Although the
        S&amp;P 500 Index includes non-U.S. companies, the Dow Jones Industrial Average
        has never included foreign companies.<sup class=\"noprint Inline-Template
        Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>As
        of December 2022, the index's five companies <a href=\"/wiki/Incorporation_(business)\"
        title=\"Incorporation (business)\">incorporated</a> in foreign countries are
        as follows:\n</p>\n<ul><li>Cayman Islands (all headquartered in China) - <a
        href=\"/wiki/JD.com\" title=\"JD.com\">JD.com</a>, <a href=\"/wiki/Pinduoduo\"
        title=\"Pinduoduo\">PDD Holdings</a></li>\n<li>England and Wales - <a href=\"/wiki/AstraZeneca\"
        title=\"AstraZeneca\">AstraZeneca</a></li>\n<li>The Netherlands - <a href=\"/wiki/ASML_Holding\"
        title=\"ASML Holding\">ASML Holding</a>, <a href=\"/wiki/NXP\" class=\"mw-redirect\"
        title=\"NXP\">NXP</a></li></ul>\n<p>Additionally, the Nasdaq-100 is also the
        only index of the three that has a regularly scheduled re-ranking of its index
        each year (in December), ensuring that the largest non-financial companies
        on Nasdaq are accurately included.<sup class=\"noprint Inline-Template Template-Fact\"
        style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<h2><span
        class=\"mw-headline\" id=\"Related_indices\">Related indices</span><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=12\"
        title=\"Edit section: Related indices\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\n<p>In
        2006, Nasdaq created a \"farm team\" index, the Nasdaq Q-50, representing
        the next fifty stocks in line to enter the Nasdaq-100. With some exceptions,
        most stocks that are added to the index come up through the Q-50. In 2011,
        Nasdaq created the NASDAQ-500 to track the 500 largest stocks on Nasdaq, and
        the Nasdaq-400, tracking those stocks not included in the Nasdaq-100.<sup
        class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup>\n</p><p>Nasdaq has also divided the 100 into
        two distinct sub-indices; the Nasdaq-100 Tech follows those components who
        service the tech sector, and the Nasdaq-100 Ex-Tech, which follows those components
        that are not considered tech companies. The latter index includes noted <a
        href=\"/wiki/Electronic_commerce\" class=\"mw-redirect\" title=\"Electronic
        commerce\">e-commerce</a> companies <a href=\"/wiki/Amazon.com\" class=\"mw-redirect\"
        title=\"Amazon.com\">Amazon.com</a> and <a href=\"/wiki/EBay\" title=\"EBay\">eBay</a>,
        which are classified as retailers.<sup class=\"noprint Inline-Template Template-Fact\"
        style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p>\n<h2><span
        class=\"mw-headline\" id=\"Components\">Components</span><span class=\"mw-editsection\"><span
